Salve,
Team Elo Plat/Dia cerca un Jungler da inserire nel progetto.
Il player deve avere le seguenti caratteristiche:
1.  Capacità di shoutcalling;
2.  Buona Champion Pool;
3.  Non essere toxic;
Attualmente gli allenamenti del team sono: Lunedì (20:30 - 23:30), Mercoledì (20:30 - 23:30), Venerdì (20:30 - 23:30).
Eventualmente, se siete interessati, potete scrivermi anche su discord (CranioRandagio#3385) o aggiungermi su League (Stay Stray).
